    false,nt"url": null,nt"notes": "English holly (Ilex aquafolia) was identified
    as a highest priority target invasive plant species in the Hakalau Forest National
    Wildlife Refuge (Hakalau) 2010 Comprehensive Conservation Plan (CCP). It is a tall
    shrub or small tree that can spread via seeds or vegetatively and can out-compete
    native species. Holly was originally planted around ranch buildings located in this
    area prior to establishment of the refuge. Hakalau area is one of few places where
    English holly is found in Hawaii, so eradication here is crucial not only for the
    refuge, but for other native ecosystems in the state. Through recent efforts (2012-14)
    we are getting an upper hand on control of holly. We propose to conclude these efforts
    by eradicating it from remaining areas. Funding would allow contractors to treat
    the last remaining dense stands of holly on the refuge, the primary seed source
    contributing to dispersal of this plant.",nt"license_title": "License Not
